'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI can’t tell you how many times I have been asked to write a book. More times than I can recall. The reality is that I don’t want to write a book. Why not? Because I’m not done yet! I’m young. I’m fun. I’m marginally ugly and I have a great family. I’m just beginning to get good. It is too early to write a book. What I have written, however, are blog posts. Lots of them. Most of them are about starting businesses. Many are about the challenges entrepreneurs face. Some are about what is involved in running a business. Others are about life in general. So rather than write a book, I decided to aggregate, curate (see how I used current buzzwords right there?) and update some of my more popular and personal blog posts from the past seven years. As you go through this collection, don’t feel you have to read it like a book. Use it as a way to get fired up. A way to get motivated. Something you can go back to when you need it. Scan it and find the posts that you can relate to. Or read every single word of every post. Either way, I hope you will find a nugget or three that will help you to reach your goals and have more fun in your life\n\nJune 13, 2017\n\u001c11\n\u0011\n\u0011\n\n\nPART ONE: The Dream\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNovember 22, 2015\n\u001c13\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn reality, I had as much doubt as confidence. I was just hoping the confidence would win over the doubt and it would all work out for the best.\n\nNovember 22, 2015\n\u001c13\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut I got paid my $1500 per month and I learned a whole lot. The company sold a total of one franchise. Which I sold. Again, I was far from a great employee. I spent too much time having fun at the expense of doing my job to the best of my ability. Going to work hung over once a week isn’t a good career move. So, in some respects I cheated them. No excuses on my part.\n\nNovember 22, 2015\n\u001c14\n\u0011\n\u0011\n\n\nPart TWO: Lessons Learned: My First Business Rules\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLesson #1: Always ask yourself how someone could preempt your products or service. How can they put you out of business? Is it price? Is it service? Is it ease of use? No product is perfect and if there are good competitors in your market, they will figure out how to abuse you. It’s always better if you are honest with yourself and anticipate where the problems will come from. Lesson #2: Always run your business like you are going to be competing with biggest technology companies in your industry—Google, Facebook, Oracle, Microsoft, whomever. They may not be your direct competitors. They may be a vendor. They may be a direct competitor and a vendor. Whatever they may be to your business, if you are in the technology business in any way shape or form, you have to anticipate that you will have to compete with one of them at some point. I ask myself every week what I would do if they entered any of my businesses. If you are ready to compete with the big guys, you are ready to compete with anyone else.\n\nDecember 30, 2015\n\u001c32\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe edge is getting so jazzed about what you do, you just spent 24 hours straight working on a project and you thought only a couple of hours had passed. The edge is knowing that you have to be the smartest guy in the room when you have your meeting and you are going to put in the effort to learn whatever you need to learn to get there.\n\nDecember 30, 2015\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe edge is knowing that when the four girlfriends you have had in the last couple years asked you which was more important, them or your business, you gave the right answer. The edge is knowing that you can fail and learn from it, and just get back up and in the game. The edge is knowing that people think you’re crazy, and they are right, but you don’t care what they think.\n\nDecember 30, 2015\n\u001c35\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"10MkTmRsYzGEt6c-vJ3WQN2rD3Dy17YKL_-nlYsM","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1Vuo2CdJSZ1QwegzSj7ObpCAo5TTpLCCtVpm9XUY","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"15ZthVlX0H1k4mBQOCi0YIoEO873LtnoiaKMhTic","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.11","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_