"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3322,"ei":3339,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3340,"ei":3679,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3680,"ei":3698,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3699,"ei":3716,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3717,"ei":4095,"sm":{"ts_ff_i":false,"ts_it":true,"ts_va":"nor","ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4096,"ei":4114,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4115,"ei":4120,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunk = [{"ty":"is","ibi":4121,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe edge is knowing how to blow off steam a couple times a week, just so you can refocus on business. The edge is knowing that you are getting to your goals and treating people right along the way, because as good as you can be, you are so focused that you need regular people around you to balance and help you. The edge is being able to confidently call out someone on a business issue because you have done your homework. The edge is recognizing when you are wrong and working harder to make sure it doesn’t happen again. The edge is being able to drill down to identify issues and problems and solve them solve before anyone knows they are there.\n\nDecember 30, 2015\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe edge is knowing that while everyone else is talking about nonsense like the “will to win” and how they know they can be successful, you are preparing yourself to compete so that you will be successful.\n\nDecember 30, 2015\n\u001c36\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat’s what makes business such an amazing sport. Everyone plays it. Everyone talks about how good he or she is or will be at it. Just a small percentage are. Every single day someone has an idea. Every day someone talks about some business he wants to start. Every day someone is out there starting a business whose entire goal is to beat the hell out of yours. How cool is that?! Every day some stranger somewhere in the world is trying to come up with a way to put you out of business. To take everything you have worked your ass off for, just take it all away. If you are in a growing industry, there could be hundreds or thousands of strangers trying to figure out ways to put you out of business. How cool is that?!\n\nDecember 30, 2015\n\u001c36\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s the sport of business. It’s not for everyone, but I love it. I’m fortunate. I have done well enough financially that I don’t have to play 24 × 7 × 365. I can and have cut back to 18 × 7 × 365. Family first, now. But in those eighteen hours, you can bet I’m competing and loving it.\n\nDecember 30, 2015\n\u001c36\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI remember the time well. I was 27 years old. I finally had my own apartment for the first time.\n\nDecember 30, 2015\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMy business, MicroSolutions, was a little more than three years old, and I would make $60K that year. HUGE money for me. Back then, getting paid your age was good, double your age was great.\n\nDecember 30, 2015\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMicroSolutions was growing, but it could have been doing better. The PC industry had gone through a major slump and pullback, and the local area networking industry had yet to take off. If we were going to grow, it was going to take working hard and working smart. It was right around then I heard something that I would hear a lot once I bought the Mavs. In sports, the only thing a player can truly control is effort. The same applies to business. The only thing any entrepreneur, salesperson or anyone in any position can control is their effort.\n\nDecember 30, 2015\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI had to kick myself in the ass and recommit to getting up early, staying up late and consuming everything I possibly could to get an edge. I had to commit to making the effort to be as productive as I possibly could. It meant making sure that every hour of the day that I could contact a customer was selling time, and when customers were sleeping, I was doing things that prepared me to make more sales and to make my company better.\n\nDecember 30, 2015\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd finally, I had to make sure I wasn’t lying to myself about how hard I was working. It would have been easy to judge effort by how many hours a day passed while I was at work. That’s the worst way to measure effort. Effort is measured by setting goals and getting results. What did I need to do to close this account? What did I need to do to win this segment of business? What did I need to do to understand this technology or that business better than anyone? What did I need to do to find an edge? Where does that edge come from, and how was I going to get there? The one requirement for success in our business lives is effort. Either you make the commitment to get results or you don’t.\n\nDecember 30, 2015\n\u001c40\n\u0011\n\u0011"},{"ty":"te","id":"i.10","spi":5063},{"ty":"te","id":"i.11","spi":5823},{"ty":"te","id":"i.12","spi":6148},{"ty":"te","id":"i.13","spi":6283},{"ty":"te","id":"i.14","spi":6512},{"ty":"te","id":"i.15","spi":7100},{"ty":"te","id":"i.16","spi":7574},{"ty":"te","id":"i.8","spi":4130},{"ty":"te","id":"i.9","spi":4819},{"ty":"as","st":"paragraph","si":4121,"ei":4121,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4122,"ei":4122,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4123,"ei":4123,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4125,"ei":4125,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4127,"ei":4127,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":4129,"ei":4129,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.