e,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunk = [{"ty":"is","ibi":8298,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou are still in school. You don’t need to have all the answers or focus on one thing. You should be trying a lot of things until you find the one thing you really love to do and are good at. When that happens, you will be able to focus. Being focused at 21 is way overrated. Now is the time to screw up, to try as many different things as you can and just maybe figure things out. The thing you do need to do is learn. Learn accounting. Learn finance. Learn statistics. Learn as much as you can about business. Read biographies about businesspeople. You don’t have to focus on one thing, but you h ef\u0027ave to create a base of knowledge so you are ready when it’s time. You never know when that time will come. But you can be ready when it does. You never know, you might end up in the adventure business!\n\nDecember 30, 2015\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you’re asking, I don’t think people “know” what they are destined to be until they try it for the first couple of times. Going to college should be about experiencing as much academically as you possibly can, but more importantly, it should be about learning how to learn and recognizing that learning is a lifelong endeavor. School isn’t the end of the learning process, it’s purely a training ground and beginning.\n\nDecember 30, 2015\n\u001c45\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn my humble opinion, once you have learned how to learn, then you can try as many different things as you can, recognizing that you don’t have to find your destiny at any given age—you just have to be prepared to run with it when you do.\n\nDecember 30, 2015\n\u001c45\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cNever settle. There is no reason to rush. If you aren’t happy with where you are, simplify your life and go out and try as many things as it takes to find what you may be destined to be. If there is such a thing. ƸOdiv\n\nDecember 30, 2015\n\u001c46\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn business, to be a success, you only have to be right once. One single time and you are set for life. That’s the beauty of the business world.\n\nDecember 30, 2015\n\u001c48\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Everyone has got the will to win; it’s only those with the will to prepare that do win.”\n\nDecember 30, 2015\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI have been in situations where I have told myself that I’m smart, I know what I’m doing, that I will figure things out as I go, so it’s okay to take on this new opportunity. Those were usually the times I made mistakes. In a lifetime of running businesses I have developed a lot of rules that have been almost infallible. Here are a few of them that I use religiously to this day: 1. Everyone is a genius in a bull market A lot people think that if they are picking stocks that keep on going up, it’s because they are smart. They fail to notice that EVERYONE is able to pick winning stocks when all stocks are going up. The same principle applies to business. Entrepreneurs have to be brutally honest with themselves and recognize where they have added value and where they have gone along for the ride. There is nothing wrong with going along for the ride and making money at it, but it will catch up with you if you lie to yourself and give yourself credit for the ride.\n\nDecember 30, 2015\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s also our challenge to recognize when there is opportunity. Sports is one of the few TiVo-proof programming options for advertisers.\n\nDecember 30, 2015\n\u001c56\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWin the battles you are in first, then worry about expansion internationally or into new businesses.\n\nw/jaac w/igs\n\nDecember 30, 2015\n\u001c59\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“The worst evaluator of talent is a player trying to evaluate himself.” The same applies to businesspeople and particularly to entrepreneurs and wannabe entrepreneurs. We tend to be less than honest with ourselves about our strengths and weaknesses.\n\nDecember 30, 2015\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI have been just as bad at this as anyone, particularly when I was getting started in the business world. For those of us who dream of starting and running a business, we know that we have to have a level of confidence in our own abilities. We don’t want to believe that there are things we can’t do. We want to believe that if we try hard enough, work long enough and get a little lucky, that the sky is the limit. The problem is that we let our confidence cloud our judgment of what we truly know about ourselves.\n\nGrow should be about finding your strengths and teaming up with those who have different ones. and then using your combined powers to create new value.\n\nDecember 30, 2015\n\u001c62\n\u0011\n\u0011"},{"ty":"te","id":"i.17","spi":8307},{"ty":"te","id":"i.18","spi":9150},{"ty":"te","id":"i.19","spi":9608},{"ty":"te","id":"i.20","spi":9885},{"ty":"te","id":"i.21","spi":10142},{"ty":"te","i