se,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":12084,"ei":12600,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12601,"ei":12753,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#424242","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":12754,"ei":12772,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunk = [{"ty":"is","ibi":12779,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI’m one of the least organized people I know. Today, I have an assistant and others that help me run my life. If you ask me where I’m going to be in three days, I have no idea. I do know that I have a kick-ass assistant who is going to make sure that when I wake up that morning, I know where I’m going and how to get there. When I was 23 years old, sleeping on the floor and starting MicroSolutions, there was no assistant. Thus, there was no organization. I was a procrastinator. Accounting was a shoebox of receipts. I was a mess.\n\nDecember 30, 2015\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut I lied to myself and said that I could deal with it. That I would make time to get it all figured out and organized. That if I only set my mind to it, I could be a details person. I could stop procrastinating. It doesn’t work that way.\n\nDecember 30, 2015\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI did the things I was good at. I could sell. So I sold. I could write software programs. I could integrate PCs. I could set up local area networks. And I did. My business grew. But it also grew out of control. A local area network or a software program without documentation is a disaster waiting to happen. And disasters did happen. Not to the point where it killed my business, but to the point where I spent far too much time fixing things rather than selling new deals. Fortunately, one of my best customers at the time was interested in becoming a partner in my business. Martin Woodall ran a company called Hytec Data Systems. He was not only smart and a good programmer, but he was the most anal, detail-oriented person I had ever met in my life. The perfect partner for me. Our partnership wasn’t always easy. We had more than our share of knock-down, drag-out fights. He, of course, would want everything done with precision, and if lack of perfection was an option, he didn’t want to do it. I, of course, was the exact opposite. I was the GO FOR IT guy. The “we can sort it out after the fact” guy. We were perfect partners. We knew and trusted the skills of the other, and although many might not think yelling was the bes f, I w-asst way to work things out, we managed. It all came down to choice. I had the choice between lying to myself and pretending that I could turn on a switch and become a details person, or accepting the fact that I’m not, and partnering with someone who is. Continuing to lie meant I would probably lose my business. Every entrepreneur faces comparable choices. Each of us has to face the reality of who we are and what we are. What choice will you make?\n\nDecember 30, 2015\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cRule #1: Sweat equity is the best startup capital The best businesses in recent entrepreneurial history are those that began with little or no money.\n\nDecember 30, 2015\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere weren’t 100-page-long business plans. In all of my businesses, I started by putting together spreadsheets of my expenses, which allowed me to calculate how much revenue I needed to break even and keep the lights on in my office and my apartment. I wrote overviews of what I was selling, why I thought the business made sense, an overview of my competition, why my product and/or service would be important to my customers and why they should buy or use it. All of it went down on a piece of yellow paper or in a word processing file, and none of it cost me more than the diet soda I was drinking while I was writing it up. I remember the foundation for each of my businesses. MicroSolutions was very simple—to use microcomputers and software to help our customers become more productive and profitable and gain a competitive advantage. AudioNet, which became Broadcast.com, was simple as well: Use the Internet to enable real-time, worldwide communications of entertainment and business applications. HDNet’s goal is to create great entertainment, originated in high-definition format, that allows our distributors to compete for the highest-margin customers.\n\nDecember 30, 2015\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce I could put the idea on paper, I gave the company a name. From there, I took the most important step: I tried n, I wof to find people to shoot holes in the name. When we started AudioNet, I remember getting an appointment with Drew Marcus of Alex. Brown (it could have been Larry, but I think it was Drew), an investment banking company. Drew followed the radio industry, and I wanted to see if there was anything he saw from his experience that would blow up the concept.\n\nDecember 30, 2015\n\u001c66\n\u0011\n\u0011"},{"ty":"te","id":"i.28","spi":12788},{"ty":"te","id":"i.29","spi":13360},{"ty":"te","id":"i.30","spi":13638},{"ty":"te","id":"i.31","spi":15371},{"ty":"te","id":"i.32","spi":15559},{"ty":"te","id":"i.33","spi":16763},{"ty":"as","st":"paragraph","si":12779,"ei":12779,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":12780,"ei":12780,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":12781,"ei":12781,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":12783,"ei":12783,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":12785,"ei":12785,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":12787,"ei":12787,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_bl_i":false,"cell_br_i":false,"cell_pr":0.0,"cell_bt_i":false,"cell_bb":{},"cell_pl":0.0}},{"ty":"as","st":"paragraph","si":12789,"ei":12789,"sm":{"ps_klt_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sm_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":false,"ps_sb_i":true,"ps_sa_i":true,"ps_kwn_i":true,"ps_al":1,"ps_ifl_i":true}},{"ty":"as","st":"cell","si":12790,"ei":12790,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb