i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":17245,"ei":17263,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunk = [{"ty":"is","ibi":17270,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEach inquiry cost me next to nothing to get great feedback. Each enabled me to check the foundation of my business idea to see if it was easy to shoot holes in, and most importantly, they all served as sales calls. Each company eventually became a customer of ours.\n\nDecember 30, 2015\n\u001c67\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cInvestors don’t care about your dreams and goals. They love that you have them. They love that you are motivated by them. Investors care about how they are going to get their money back and then some. Family cares about your dreams. Investors care about money. There is a reason why venture capitalists are often referred to as Vulture Capitalists. The minute you slide off course from the promises you made to get the money, your dreams fall in jeopardy. You will find yourself making promises to keep investors at bay. You will find yourself avoiding your investors. Then you will find yourself on the outside looking in. The reality of taking money from non-family members is that they are doing it for only one reason, to make more money. If you can’t deliver on that promise, you are out. You will be removed from the company you started. You w star backill find someone else running your dream company. If this sounds like a scene out of The Sopranos or some TV episode about a loan shark, you are right. The only difference is that it’s all legal.\n\nDecember 30, 2015\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere are only two reasonable sources of capital for startup entrepreneurs: your own pocket and your customers’ pockets. I personally would never even take money from a family member.\n\nDecember 30, 2015\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou shouldn’t have to take money from anyone. Businesses don’t have to start big. The best ones start small enough to suit the circumstances of their founders. I started MicroSolutions by getting an advance of $500 from my first customer. The business didn’t grow quickly in the first couple years—just up to four people, and we all worked dirt cheap. So what’s wrong with that? Nothing! It’s okay to start slow. It’s okay to grow slow. As much as you want to think that all things would change if you only had more cash available, they probably won’t. The reality is that for most businesses, they don’t need more cash, they need more brains.\n\ngrow needs to pivot BM to monthly subscription like hackerrank or get money from users.. we keep running after VC money. we need to get the most out of the HR we have. and we need to get this e-Spire thing figured out. i still don\u0027t know what it is, and I don\u0027t like that situation.\n\nDecember 30, 2015\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Treat your customers like they own you. Because they do.”\n\nDecember 30, 2015\n\u001c74\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“You Always Have Other Options.”\n\nDecember 30, 2015\n\u001c74\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI personally think that the only way you can connect to your customers is to put yourself in their shoes. For me personally, if I can’t be a customer of my own product, then I probably am not going to do a good job running the company. When I go to a Landmark Theater, I don’t call ahead and tell them I’m coming so I can get special treatment. I stand in line and pay for my ticket like everyone else. I get my popcorn and Diet Coke like everyone else. I get my seat like everyone else.\n\nDecember 30, 2015\n\u001c74\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe best focus groups are your customers telling you what they think. No company is perfect, but the CEO who doesn’t listen to direct feedback from customers will not take the company as far as it can go.\n\nDecember 30, 2015\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhining is the first step toward change. It’s the moment when you realize something is very wrong and that you have to take the initiative to do something about it. Sure, criticism usually comes along with the territory. Who cares? People in media like to call people whiners. With a negative connotation. Because, of course, people in the media are nonwhiners. Which they, amazingly enough, think is a good thing. People who don’t whine are punching bags. They just go about their days, their jobs, their lives, knowing there is nothing they can do to change a darn thing, so why say a word? They see no reason to whine because they know they are incapable of effecting change. Call me a whiner any day.\n\nDecember 30, 2015\n\u001c78\n\u0011\n\u0011"},{"ty":"te","id":"i.34","spi":17279},{"ty":"te","id":"i.35","spi":17583},{"ty":"te","id":"i.36","spi":18676},{"ty":"te","id":"i.37","spi":18898},{"ty":"te","id":"i.38","spi":19864},{"ty":"te","id":"i.39","spi":19961},{"ty":"te","id":"i.40","spi":20032},{"ty":"te","id":"i.41","spi":20558},{"ty":"te","id":"i.42","spi":20801},{"ty