s_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21510,"ei":21528,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunk = [{"ty":"is","ibi":21535,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn business, one of the challenges is making sure that your product is the easiest to experience and to sell.\n\nDecember 30, 2015\n\u001c82\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMoral of the story: Make your product easier to buy than your competition, or you will find your customers buying from them, not you.\n\nDecember 30, 2015\n\u001c82\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo repeat, it’s more important to know how our customers’ businesses operate than how the sports business operates. What we do is easy.\n\nDecember 30, 2015\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c2. If you can sell, you can get a job—anywhere, anytime\n\nDecember 30, 2015\n\u001c85\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe best salespeople are the ones who put themselves in their customer’s shoes and provide a solution that makes the customer happy. The best salesperson is the one the customer trusts and never has to question. The best salesperson is the one who knows that with every cold call made, he is closer to helping someone. The best salesperson is the one who takes immense satisfaction from the satisfaction her customer gets. The best salesperson is the one who wakes up early every morning excited to come to the office, get on the phone and let people know exactly why he loves his product, job and clients. Sound corny? It is. It’s also very simple. And it’s the most important job in every company. There has yet to be a successful company that has survived with zero sales. So if selling is the most important job in a company, why do fewer and fewer people seem to be wanting the job?\n\nDecember 30, 2015\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you don’t have a job, or don’t have the job you want, get a job in sales. Every single person on this planet can learn to be a great salesperson. All you have to do is put in the effort and care about your company, your prospects and customers. Once you excel at selling, getting a job in sports is easy. But then again, if you are good, I’m sure the company you work for is going to do everything they can to keep you.\n\nDecember 30, 2015\n\u001c86\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you keep on pushing with someone who obviously does not want the product for whatever reason, you are making multiple mistakes: 1. You are wasting your and the prospect’s time. Wasting your time means you are not selling to the next prospect. Always remember what I tell myself: “Every no gets me closer to a yes.” You have to move on and start communicating with someone you know might buy your product rather than wasting more time with someone you already know won’t buy your product/service/idea. 2. The more you push someone who has said no, the more likely you are to appear desperate, and that desperation impacts your brand as a salesperson and the brand of the product. Just because it worked for Bud Fox doesn’t mean it will work for you. That was a movie. 3. It’s a sign of fear and laziness. It takes work to find qualified\n\nDecember 30, 2015\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cprospects. It also takes courage to overcome the fear of not knowing what will happen next. It is very, very easy to send someone an email every day or even hour. That is what a lazy person is going to do: spend all of two seconds hitting the resend button. A smart, focused and successful salesperson will gear up and do the homework necessary to find their next customer. That is a sign of confidence. If you believe deeply in what you do, it is going to be fun and exciting to find your next customer and show off how amazing your products/service/idea is. If the last person didn’t get it, that’s his or her problem. Not yours. That is what successful businesspeople do. What do you do?\n\nDecember 30, 2015\n\u001c88\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c1. Recognize that it’s okay to live like a student It doesn’t matter where you live. It doesn’t matter how you live. It doesn’t matter what kind of car you drive. It doesn’t matter what kind of clothes you wear. It doesn’t matter. Your biggest enemies are your bills. The more you owe, the more you stress. The more you stress over bills, the more difficult it is to focus on your goals. More importantly, if you set your monthly income requirements too high, you eliminate a significant number of opportunities. The cheaper you can live, the greater your options. Remember that.\n\nDecember 30, 2015\n\u001c91\n\u0011\n\u0011"},{"ty":"te","id":"i.43","spi":21544},{"ty":"te","id":"i.44","spi":21692},{"ty":"te","id":"i.45","spi":21864},{"ty":"te","id":"i.46","spi":22038},{"ty":"te","id":"i.47","spi":22132},{"ty":"te","id":"i.48","spi":23058},{"ty":"te","id":"i.49","spi":23519},{"ty":"te","id":"i.50","spi":24396},{"ty":"te","id":"i.51","spi":25125},{"ty":"as","st":"paragraph","si":21535,"ei":21535,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":tr