iving cheaply and ready to find out where your future lies, now is the time to try anything. WTF-time means fighting through your fears to take a job in a new industry. It means trying different things to find out what it is you love to do. There will be no such thing as too many jobs. In this type of economy getting a job is tough if not often impossible, so you are going to have bust ass to create opportunities for yourself. Creating opportunities means looking where others are not. Look outside of where all your friends are looking. Make a list of jobs and\n\nDecember 30, 2015\n\u001c91\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJust like you never thought you would fall girlo take a in love again after your first heartbreak, you will find another industry or job that you love as much. Move down your list to other things. Then get ready to work. Hard.\n\nDecember 30, 2015\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThen, when you do find a job, remind yourself that you are winging it. Everyone always sees the bright side of the job they just took. You have to. The new job you just scored that you thought would be amazing, will be amazing. Most likely it will be amazing for about three months. Then you will realize it’s not so amazing and you will need to find something else that’s amazing. That’s okay. You don’t have to be right every time. You just have to be right one time. Finding the right job is a lot like dating. It’s hard until you start, then when you start, it’s great until it’s not. Then it’s frustrating as hell until you get it right. But when you do, it all comes together.\n\nDecember 30, 2015\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s really easy to know if you are in the right job. If it matters how much you get paid, you are not in a job you really love. I’m not saying that you shouldn’t want to make more money. I’m not saying that you shouldn’t\n\nDecember 30, 2015\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbust your ass to make as much money as possible. That’s not the issue. The issue is whether or not you truly love your job. If you love what you do so much that you are willing to continue to live like a student in order to be able to stay in the job, you have found your calling.\n\nDecember 30, 2015\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce you have found out what you love to do, there is only one goal: to be the best in the world at it. It doesn’t matter if you are a filing clerk, an athlete, an accountant or a bartender. All that matters is that you do whatever you can to be the best. Of course, “the best” is a relative term. The one person whom you should never believe when it comes to evaluating your abilities? You. The very worst judge of your abilities is you. Self-evaluation is never successful. When you are the best at something, the demand for your services will grow. People want to hire the best. They want to be associated with the best. In 2012, in this economy, so many people switch jobs and industries, and it’s much easier to stay connected via social networks and other digital means, which means that people who need you can and will find you. So rather than trying to convince people you are the best, let the quality of your work do the talking.\n\nDecember 30, 2015\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou are going to screw up. We all do. I can’t tell you how many times I did and continue to. It happens too often. But no matter what happens, every morning, the minute after you wipe away the crust from your eyes, remind yourself that you are going to enjoy every minute of the day. You are going to enjoy the twenty interviews you have. You are going to enjoy waiting in the heat for your roommate to pick you up afterward. You are going to enjoy realizing how frayed your collar has become and how sick you are of your one, lonesome tie. You are going to enjoy all the bullshit you have to deal with as you chase your goals and dreams, because you want to remember them all. Each and every experience will serve as\n\nDecember 30, 2015\n\u001c93\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmotivation and provide great memories when you finally make it all happen. It’s your choice. What are you going to do?\n\nDecember 30, 2015\n\u001c93\n\u0011\n\u0011"},{"ty":"te","id":"i.52","spi":25743},{"ty":"te","id":"i.53","spi":26359},{"ty":"te","id":"i.54","spi":26624},{"ty":"te","id":"i.55","spi":27345},{"ty":"te","id":"i.56","spi":27605},{"ty":"te","id":"i.57","spi":27924},{"ty":"te","id":"i.58","spi":28903},{"ty":"te","id":"i.59","spi":29659},{"ty":"as","st":"paragraph","si":25734,"ei":25734,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":25735,"ei":25735,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":25736,"ei":25736,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":25738,"ei":25738,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":25740,"ei":25740,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":25742,"ei":25742,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_br":{},"cell_pb_i":false,"cell_b