se,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":29662,"ei":29781,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":29782,"ei":29800,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw"  nonce="Dr72NPSyPpjSsc48FQ4xzt1s1Nw">DOCS_modelChunk = [{"ty":"is","ibi":29807,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“The best way to predict the future is to invent it.”\n\nDecember 30, 2015\n\u001c96\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI’m working with a company that at one point had a product that was not only best in its class, but also technically far ahead of its competition. It created a better way of offering its service, and customers loved it and paid for it. Then it made a fatal mistake. It asked its customers what features they wanted to see in the product, and they delivered on those features. Unfortunately for this company, its competitors didn’t ask customers what they wanted. Instead, they had a vision of ways that business could be done differently and, as a result, better. Customers didn’t really see the value or need until they saw the new product. When they tried it, they loved it.\n\nDecember 30, 2015\n\u001c96\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEntrepreneurs always need to be reminded that it’s not the job of their customers to know what they don’t. In other words, your customers have a tough enough time doing their jobs. They don’t spend time trying to reinvent their industries or how their jobs are performed. Sure, every now and then you come across an exception. But you can’t bet the company on your finding that person among your customers. Instead, part of every entrepreneur’s job is to invent the future.\n\nDecember 30, 2015\n\u001c96\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccall it “kicking your own ass.” Someone is out there looking to put you out of business. Someone is out there who thinks they have a better idea than you have. A better solution than you have. A better or more efficient product than you have. If there is someone out there who can “kick your ass” by doing it better, it’s part of your job as the owner of the company to stay ahead of them and “kick your own ass” before someone else does. Your customers can tell you the things that are broken and how they want to be made happy. Listen to them. Make them happy. But don’t rely on them to create the future road map for your product or service. That’s your job.\n\nDecember 30, 2015\n\u001c96\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c1. Don’t start a company unless it’s an obsession and something you love. 2. If you have an exit strategy, it’s not an obsession. 3. Hire people who you think will love working there. 4. Sales Cure All. Know how your company will make money and how you will actually make sales. 5. Know your core competencies and focus on being great at them. Pay up for people in your core competencies. Get the best. Outside the core competencies, hire people that fit your culture but are cheap.\n\nDecember 30, 2015\n\u001c99\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c12. Make the job fun for employees. Keep a pulse on the stress levels and accomplishments of your people and reward them. My first company, MicroSolutions, when we had a record sales month, or someone did something special, I would walk around handing out $100 bills to salespeople. At Broadcast.com and MicroSolutions, we had a company shot. The Kamikaze. We would take people to a bar every now and then and buy one or ten for everyone. At MicroSolutions, more often than not we had vendors cover the tab. Vendors always love a good party.\n\nDecember 30, 2015\n\u001c100\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c1. Time is more valuable than money You have to learn how to use time wisely and be productive. How wisely you use your time will have far more impact on your life and success than any amount of money.\n\nDecember 30, 2015\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cCommit random acts of kindness\n\nDecember 30, 2015\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce you are prepared and you think you have every angle of preparation covered, you have to go for it .\n\nDecember 30, 2015\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c5. Don’t let fear be a roadblock You can use fear as a roadblock or as motivation. There is always going to be someone who is competing with you, and sometimes they are going to win. Rather than not doing something for fear of losing, take on the challenge. If you fail, get back up and go for it again. I have been fired from more jobs than most people have had! In the search for success, you can fail any number of times, but you only have to get it right one time.\n\nDecember 30, 2015\n\u001c102\n\u0011\n\u0011"},{"ty":"te","id":"i.60","spi":29816},{"ty":"te","id":"i.61","spi":29908},{"ty":"te","id":"i.62","spi":30623},{"ty":"te","id":"i.63","spi":31135},{"ty":"te","id":"i.64","spi":31835},{"ty":"te","id":"i.65","spi":32356},{"ty":"te","id":"i.66","spi":32937},{"ty":"te","id":"i.67","spi":33178},